package Tasks;

public class ForLoopTask6 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		for(int i=1;i<=3;i++) {

			for(int x=1;x<=3;x++) {
				
				System.out.print("*");
				
				System.out.print("#");
				
			}
			System.out.println();
		}
			

	}
}
